import s from "./MyPosts.module.css";
import Post from "./post/Post";

const MyPosts = (props) => {

  let postData = [
    { message: "hi", id: 1, likes:"15" },
    { message: "how is your name", id: 1, likes:"15" },
    { message: "what are you doing", id: 1, likes:"15" },
  ];

  return (
    <div className={s.content}>
      <h3>My Posts</h3>
      <div>
        <textarea></textarea>
        <div>
          <button>send</button>
        </div>
      </div>
      <Post message={postData[0].message} like={postData[0].like} id={postData[0]} />
      <Post message="second" like="20" />
      <Post message="3" like="35" />
    </div>
  );
};

export default MyPosts;
